import React, {Component} from 'react';
import './App.css';
import { findDaysToShip } from './utils/util';

import {
  MDBCard,
  MDBCardBody,
  MDBCardTitle,
  MDBCardText,
  MDBRow,
  MDBCol,
  MDBBtn
} from 'mdb-react-ui-kit';

class App extends Component {
  constructor(props) {
    super(props);
    this.state = {
      products: []
    }
  }

  componentDidMount() {
    let url = "http://localhost:3002/products"
    fetch(url)
      .then(resp => resp.json())
      .then(data => {
        let products = data.map((product, index) => {
          return (
            <MDBRow>
              <MDBCol sm='6'>
              <MDBCard>
              <MDBCardBody>
              <MDBCardTitle>{product.productName}</MDBCardTitle>
              <MDBCardText>{product.inventoryQuantity}</MDBCardText>
              <MDBCardText>Max Shipping Date If Ordered Today:{ findDaysToShip(product).toDateString() }</MDBCardText>
              </MDBCardBody>
              </MDBCard>
              </MDBCol>
            </MDBRow>
          )
        })
        this.setState({products: products});
      })
  }
  render() {
    return (
      <div className="App">
        {this.state.products}
      </div>
    );
  }
}

export default App;
